project: "key_parameters_select"
maxiterations: 500
startworkload: ""
stopworkload: ""
object :
  -
    name : "x1"
    info :
        desc : "x1"
        get : "cat key_parameters_select/key_parameters_select.py | grep -i '^x1 =' | awk -F '=' '{print $2}'"
        set : "sed -i 's/^x1 =\\s*[0-9]*/x1 = $value/g' key_parameters_select/key_parameters_select.py"
        needrestart : "false"
        type : "continuous"
        scope :
          - 1
          - 5
        dtype : "int"
